            |[unfilled]| & |[unfilled]| & |[unfilled]| & |[filled]| & |[filled]| & |[filled]| \\
            |[unfilled]| & |[unfilled]| & |[unfilled]| & |[filled]| & |[filled]| & |[filled]| \\
        };
        \node[above=1cm of block_random_column_matrix] {\textbf{Block Random Column Sparsity}};

    \end{tikzpicture}
\end{document}
